import React,{Component} from "react";

class Success extends Component{
  
  render(){
    return(
      <div style={{
        color:"green",
        background:"greenyellow",
        padding:"8px",
        border:"3px solid green",
        textAlign:"center"
      }}
>
        Success work
      </div>
    
    )
  }
}

export default Success;
